import React from "react";
import "./Landing.css";
import { Link } from "react-router-dom";

function Landing() {
  // const SignInHandler = () => {
  //   console.log("worked");
  // };
  return (
    <div class=".navbar">
      <span className="Studentsclick" class=".navbar">
        Students
      </span>
      <span className="Employersclick" class=".navbar">
        {" "}
        Employers
      </span>
      <Link
        className="Signinclick"
        class=".navbar"
        to="./../Signin/Pages/Signin"
      >
        SignIn
      </Link>
    </div>
  );
}

export default Landing;
